@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://fyrum.com/index.php"), domain('fyrum.com') {

body {
color:#045165 !important;
background:#045165 !important;
}

textarea:focus, select:focus, .post:focus, .btnmain:focus, .btnlite:focus, .btnfile:focus {
border-color:#CC6600 !important;
}

.row1, .row2, .row3, .legend, .forumrules, tr.row1 .row, tr.row2 .row, tr.row3 .row, .postbottom {
background:#191919 !important;
}

a.topictitle, .postbody a, a.topictitle:visited, .postbody a:visited {
color:#2370B6 !important;
}

a:hover,a.topictitle:visited:hover, .postbody a:visited:hover  {
color:#CC6600!important;
}

th {
background:#233B45 !important;
}

.navrow {
color:#CC6600 !important;
background:#233B45 !important;
}

a.link-new, a.link-new:visited {
color:#FF9900 !important;
}

div[id=logo-right] {
background-image:none !important;
}

div[id=logo-left] {
background-image:none !important;
}

